/**
 * LINEログファイル（プレーンテキスト）の選択
 */
function selectLogTextFile(e) {
  // ファイルの選択をしてからアップロードする
  $("upload_file").click();
}

/**
 * LINEログファイル（プレーンテキスト）のアップロード
 */
function uploadLogTextFile(e) {
  // ファイル要素から、選択されたファイルを取得する
  const files = $("upload_file").files;

  // ファイルが選択されていなかったら終了
  if (files.length === 0) {
    alert("ファイルが選択されていません");
    return false;
  }

  // 1つ目のファイルを取得する
  const file = files[0];

  // アップロードされたファイルからテキストを抽出
  const reader = new FileReader();
  reader.readAsText(file);
  reader.onload = () => {
    // 成形したHTMLをプレビュー画面に適応
    $("contents").innerHTML = convertLogTextToHTML(reader.result);
  }

  // Submitイベントをキャンセルする
  return false;
}

/**
 * アップロードされたログファイルからHTMLのコンテンツ部分をHTMLに変換する
 */
function convertLogTextToHTML( text ) {
  console.log(text);
  let html = "";
/*
  let html = `<div class="balloon_r">
  <p class="says">あ</p>
</div>
<div class="balloon_l">
  <p class="says">うん</p>
</div>`;
*/

  let groups, res, r, msg = "", line = 1;
  text.split('\n').forEach( (item) => {
    console.log(item);
    if (item.match(/(?<at>\d\d?:\d\d)\t(?<userName>.+)\t(?<firstLine>.+)/) !== null) {
      res = item.match(/(?<at>\d\d?:\d\d)\t(?<userName>.+)\t(?<firstLine>.+)/);

      if (msg !== "") {
        html += writeMsg( groups, msg );
      }
      groups = res.groups;
      msg = groups.firstLine;
      line++;    
    } else if (item.match(/^(?<date>\d+\/\d+\/\d+\(.+\)$)/) !== null) {
      res = item.match(/^(?<date>\d+\/\d+\/\d+\(.+\)$)/);

      if (msg !== "" && groups !== undefined) {
        html += writeMsg( groups, msg );
      }
      html += `<div class="date">${res.groups.date}</div>`;
      msg = "";
      line++;    
    } else if (item.match(/\[LINE\]\s(?<opponentName>.+)とのトーク履歴/) !== null) {
      res = item.match(/\[LINE\]\s(?<opponentName>.+)とのトーク履歴/);

      setOpponentName( res.groups.opponentName );
      html += `<div class="title">${getOpponentName()}とのトーク履歴</div>`;
      line++;    
    } else if (item.match(/^保存日時：/) !== null && line == 2) {
      // nop
    } else if (item.trim() !== "") {
      msg += "<br>" + item;
    }

  });

  // 最後のメッセージを出力
  html += writeMsg( groups, msg );

  console.log(html);
  return html;
}

/**
 * メッセージを出力文字列に追加
 * @param groups string matchの結果
 * @param msg string 投稿され内容
 * @returns HTML 形式の出力文字列
 */
function writeMsg( groups, msg ) {
  const baloonClass = getOpponentName().trim() === groups.userName.trim() ? "balloon_l" : "balloon_r";

  // すでにあるメッセージをHTMLに成形
  let html = `<div class="${baloonClass}">`;
  if ( baloonClass === "balloon_l" ) {
    html += `<p class="says">${msg.trim()}</p><div class="prop">${groups.at}</div>`;
  } else {
    html += `<div class="prop">既読<br>${groups.at}</div><p class="says">${msg.trim()}</p>`;
  }
  html += `</div>`;  

  return html;
}


/**
 * アップロードされたファイルからお相手の名前を取得する
 */
function getOpponentName() {
  return opponentName === undefined ? "サンプル" : opponentName;
}

/**
 * アップロードされたファイルからお相手の名前を取得する
 */
function setOpponentName( name ) {
  opponentName = name;
}

/**
 * HTMLファイルのダウンロード
 */
function downloadHTMLFile(e) {
  // アンカータグの作成
  const downLoadLink = document.createElement("a");

  // ダウンロードするHTML文章の生成
  const outputDataString = getOutputHTML();
  const downloadFileName = "[LINE] " + getOpponentName() + ".html"
  downLoadLink.download = downloadFileName;
  downLoadLink.href = URL.createObjectURL(new Blob([outputDataString], {type: "text/html"}));
  downLoadLink.dataset.downloadurl = ["text/html", downloadFileName, downLoadLink.href].join(":");
  downLoadLink.click();
}

window.onload = () => {
  $("download_button").addEventListener("click", e => downloadHTMLFile(e));
  $("upload_button").addEventListener("click", e => selectLogTextFile(e));
  $("upload_file").addEventListener("change", e => uploadLogTextFile(e));
}
